// src/Homepage.js
import React, { useState } from 'react';
import DisplaySongs from './DisplaySongs';
import Footer from './footer';
import fetchAlbumById from './trying'; // Import the fetchAlbumById function

function Homepage() {
  const [selectedSong, setSelectedSong] = useState(null);
  // Example usage of fetchAlbumById
  const fetchAlbumData = async (albumId) => {
    try {
      const albumData = await fetchAlbumById(albumId);
      console.log('Fetched album data:', albumData);
    } catch (error) {
      console.error('Error fetching album data:', error);
    }
  };

  console.log(selectedSong);

  return (
    <div>
      <h1>Welcome to the Music App</h1>
      <DisplaySongs onSongClick={(song) => setSelectedSong(song)} />
      {selectedSong && (
        <div>
          <Footer selectedSong={selectedSong} />
          {/* Example usage of fetchAlbumById */}
          <button onClick={() => fetchAlbumData(selectedSong.albumId)}>
            Fetch Album Data
          </button>
        </div>
      )}
    </div>
  );
}

export default Homepage;
